import LogoIcon from "./icons/logo";
import SearchIcon from "./icons/search";
import WishlistIcon from "./icons/wishlist";
import CartIcon from "./icons/cart";

function App(props) {
  return (
    <>
      <Header />
      {props.children}
      <Footer />
    </>
  );
}

function Header() {
  return (
    <>
      <div className="flex justify-end bg-gray-200 px-5 py-2">
        <ul className="flex space-x-3">
          <li>Register</li>
          <li>|</li>
          <li>Account</li>
        </ul>
      </div>
      <div className="flex justify-between items-center border px-5 py-2">
        <LogoIcon />
        <div className="flex items-center space-x-3 sm:space-x-6">
          <ul className="flex space-x-6">
            <li>New x Featured</li>
            <li>Men</li>
            <li>Women</li>
          </ul>
          <div className="flex space-x-2 bg-gray-100 hover:bg-gray-200 rounded-3xl p-1.5">
            <SearchIcon />
            <input
              className="bg-transparent"
              style={{ outline: "none", maxWidth: "12vw" }}
              name="search"
              placeholder="Search"
            />
          </div>
          <div className="flex space-x-1">
            <button className="rounded-2xl p-1.5 hover:bg-gray-200">
              <WishlistIcon />
            </button>
            <button className="rounded-2xl p-1.5 hover:bg-gray-200">
              <CartIcon />
            </button>
          </div>
        </div>
      </div>
    </>
  );
}

function Footer() {
  return <footer>Footer</footer>;
}

export default App;
